import logo from './logo.svg';
import './App.css';

function Test(props) {
  return (
    <div>
      <p>It is currently: {props.date.toLocaleTimeString()}.</p>
    </div>
  );
}

function App() {
  return (
    <div>
      <p>Head: </p>
      <Test date={new Date()} />
    </div>
  );
}

export default App;
